script: |
  super -f tsv -I q11891.sql | sort > q11891.out

vector: true

inputs:
  - name: q11891.sql
    data: |
      SELECT DISTINCT * FROM tab1 cor0 WHERE ( + + col0 ) BETWEEN + CAST ( + ( ( + col1 ) ) AS INTEGER ) / col0 AND ( col1 * col0 ) OR NOT col0 IS NOT NULL;
  - name: tab1

outputs:
  - name: q11891.out
    data: |
      51	14	96
      85	5	59
      91	47	68
